import { NgModule } from '@angular/core';
import { RouterModule, Routes } from '@angular/router';
import { DatosDeLaEmpresaComponent } from './datos-de-la-empresa/datos-de-la-empresa.component';
import { ActualizarCuentaComponent } from './actualizar-cuenta/actualizar-cuenta.component';

const routes: Routes = [
  {
    path: '', children: [
      { path: 'datos de la empresa', component: DatosDeLaEmpresaComponent },
      { path: 'actualizar cuenta', component: ActualizarCuentaComponent }
    ]
  }
];

@NgModule({
  imports: [RouterModule.forChild(routes)],
  exports: [RouterModule]
})
export class ConfiguracionesRoutingModule { }
